import React from 'react'
import Comp1 from './components/Comp1'
export default function App() {
  var radiopar = [
    { value : 1, text : "radio1" },
    { value : 2, text : "radio2" },
    { value : 3, text : "radio3", checked : true },
    { value : 4, text : "radio4" }
    ];
  return (
    <div>
      <Comp1 radios={radiopar}/>
    </div>
  )
}
